 *  `t(t(a1, b1), ..., t(an, bn))`. If the two tuples have different sizes,
 *  the extra elements of the larger tuple will be disregarded.
 *  The result is typed as `TupleX<Tuple2<TA1, TB1>, ..., Tuple2<TAn, TBn>>`.
 *
 */

